Kalapuikko: Ainekset: Atlantin TURSKA 60% (Gadus morhua), maissi, vesi, rapsiöljy, panerointi (perunatärkkelys, riisijauho, maissijauho, muunnettu perunatärkkelys, sipuli, suola, stabilointiaine E 415, mustapippuriuute), suola, sokeri, valkopippuri., KALAPUIKKO ON GLUTEENITON,, PYYDÄ GLUTEENITON KASTIKE.
Sitruunakastike: margariini, kurkuma, VEHNÄjauho, kasvisrasvasekoite (MAITO, LAKTOOSITON, rapsiöljy, muunnettu maissi- ja tapiokatärkkelys, emulgointiaine, aromi, väri (betakaroteeni)
), suola, kasvisliemijauhe (Suola, glukoosisiirappi, aromi, sipuli, modifioitu tärkkelys, maltodekstriini, rapsiöljy, kasvistiivistettä (porkkana, purjo, her kkusieni, parsakaali, paprika), mausteet, sokeri, etikkauute, rosmariiniuute), sokeri, valkopippuri, sitruunatäysmehu.
